import Header from '../includes/Header'
import Head from 'next/head';

const DeskTopLayout = props => (
  <>
    <Head>
      <title>卡利娛樂城</title>
    </Head>
    <Header />
    {props.children}
  </>
);

export default DeskTopLayout
